import JapanImg from "../startseite_assets/japan.png"

function MainContentStartseite(){
    return(
        <div className="banner_startseite container_main blur">
            <div class="hero-text">
                <h1>Ich bin Khang Dinh</h1>
                <p>Willkommen auf meiner Seite</p>
            </div>
        </div>
    // <h1 className="container_main">hallo</h1>
    )
}

export default MainContentStartseite
